(13, 'Aladdin', 'Um jovem humilde descobre uma lâmpada mágica, com um gênio que pode lhe conceder desejos. Agora o rapaz quer conquistar a moça por quem se apaixonou, mas o que ele não sabe é que a jovem é uma princesa que está prestes a se noivar. Agora, com a ajuda do gênio, ele tenta se passar por um príncipe para conquistar o amor da moça e a confiança de seu pai.', '2h 8m', '2019', 2, 1, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(14, 'Malévola: Dona do Mal', 'Em Malévola: Dona do Mal, uma sequência do sucesso de bilheteria global de 2014, Malévola e sua afilhada Aurora começam a questionar os complexos laços familiares que as prendem à medida que são puxadas em direções diferentes por casamentos, aliados inesperados e novas forças sombrias em jogo.', '1h 58m', '2019', 2, 1, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(15, 'Shazam', 'Billy Batson tem apenas 14 anos de idade, mas recebeu de um antigo mago o dom de se transformar em um super-herói adulto chamado Shazam. Ao gritar a palavra SHAZAM!, o adolescente se transforma nessa sua poderosa versão adulta para se divertir e testar suas habilidades. Contudo, ele precisa aprender a controlar seus poderes para enfrentar o malvado Dr. Thaddeus Sivana.', '2h 12m', '2019', 3, 1, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(16, 'Pokémon: Detetive Pikachu', 'Um jovem une forças com o detetive Pikachu para desvendar o mistério por trás do desaparecimento de seu pai. Perseguindo pistas pelas ruas de Ryme City, a dupla dinâmica logo descobre uma trama desonesta que representa uma ameaça ao universo Pokémon.', '1h 45m', '2019', 1, 1, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(17, 'Dumbo', 'Holt Farrier é uma ex-estrela de circo que retorna da guerra e encontra seu mundo virado de cabeça para baixo. O circo em que trabalhava está passando por grandes dificuldades, e ele fica encarregado de cuidar de um elefante recém-nascido, cujas orelhas gigantes fazem dele motivo de piada. No entanto, os filhos de Holt descobrem que o pequeno elefante é capaz de uma façanha enorme: voar.', '1h 52m', '2019', 1, 1, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(18, 'Nós', 'Adelaide e Gabe levam a família para passar um fim de semana na praia e descansar. Eles começam a aproveitar o ensolarado local, mas a chegada de um grupo misterioso muda tudo e a família se torna refém de seres com aparências iguais às suas.', '2h 1m', '2019', 5, 3, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(19, 'O Farol', 'The Lighthouse é um futuro filme em preto e branco de 2019, do gênero terror psicológico, dirigido por Robert Eggers e co-escrito por Max Eggers. É estrelado por Willem Dafoe e Robert Pattinson.', '1h 50m', '2019', 5, 3, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(20, 'A Maldição da Chorona', 'Em Los Angeles, na década de 1970, uma assistente social cria seus dois filhos sozinha depois de ser deixada viúva. Ela começa a ver semelhanças entre um caso que está investigando e a entidade sobrenatural chamada de Chorona. A lenda conta que, em vida, Chorona afogou seus filhos após um ataque de ciúmes e depois se jogou no rio, se debulhando em lágrimas. Agora ela chora eternamente, indo atrás e capturando outras crianças para substituir seus filhos.', '1h 33m', '2019', 4, 3, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(21, 'Zumbilândia: Atire Duas Vezes', 'Uma década depois do sucesso de Zombieland, e deste se ter tornado um filme de culto, o elenco principal (Woody Harrelson, Jesse Eisenberg, Abigail Breslin e Emma Stone) volta a juntar-se ao realizador Ruben Fleischer (\"Venom\") e aos argumentistas originais Rhett Reese & Paul Wernick (\"Deadpool\") para lançar \"Zombieland: Tiro Duplo\". Neste novo filme, através do caos hilariante que vai desde a Casa Branca à América profunda, estes quatro caçadores vão enfrentar os novos tipos de zombies que evol', '1h 39m', '2019', 5, 3, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(22, 'Escape Room', 'Seis estranhos estão em circunstâncias fora de controle e devem usar sua inteligência e encontrar as pistas para escapar ou morrer na tentativa.', '1h 39m', '2019', 4, 3, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(23, 'Frozen 2', 'De volta à infância de Elsa e Anna, as duas garotas descobrem uma história do pai, quando ainda era príncipe de Arendelle. Ele conta às meninas a história de uma visita à floresta dos elementos, onde um acontecimento inesperado teria provocado a sepaação dos habitantes da cidade com os quatro elementos fundamentais: ar, fogo, terra e água. Esta revelação ajudará Elsa a compreender a origem de seus poderes.', '2h', '2019', 1, 4, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(24, 'Pets – A Vida Secreta dos Bichos 2', 'DescriçãoA vida de Max e Duke muda bastante quando sua dona tem um filho. De início eles não gostam nem um pouco deste pequeno ser que divide a atenção, mas aos poucos ele os conquista. Não demora muito para que Max se torne superprotetor em relação à criança, o que lhe causa uma coceira constante. Quando toda a família decide passar uns dias em uma fazenda, os cachorros enfrentam uma realidade completamente diferente com a qual estão acostumados.\r\n', '1h 26m', '2019', 1, 4, , '');
