(25, 'Abominável', 'Quando a adolescente Yi (Chloe Bennet, Agentes da SHIELD da Marvel) encontra um jovem Yeti no telhado de seu prédio em Xangai, ela e seus amigos travessos, Jin (Tenzing Norgay Trainor) e Peng (Albert Tsai), o nomeiam \"Everest\". e embarcam em uma jornada épica para levar a criatura mágica de volta para sua família no ponto mais alto da Terra. Mas o trio de amigos precisará estar sempre um passo à frente de Burnish (Eddie Izzard), um homem rico com a intenção de capturar um Yeti, e da zoóloga Dr. ', '1h 37m', '2019', 1, 4, , '');
INSERT INTO `filme` (`IdFilme`, `NomeFilme`, `Sinopse`, `TempoDuracao`, `Ano`, `IdClassificacaoFkFilme`, `IdGeneroFkFilme`, `Imagem`, `Cartaz`) VALUES
(26, 'O Parque dos Sonhos', 'A jovem otimista e sonhadora June encontra escondido na floresta um parque de diversões chamado Wonderland, que é cheio de passeios e animais que falam. O único problema é que o parque está confuso e desorganizado. June logo descobre que o parque veio de sua imaginação e que ela é a única que pode tornar o lugar mágico de novo.', '1h 26m', '2019', 1, 4, , '');

